import React from "react";
import ReactDOM from "react-dom";
import App from "./components/App";
import contacts from "./contacts"


ReactDOM.render(
    <div>
        <h1 className="heading">My Contacts</h1>
        <App name={contacts[0].name} image={contacts[0].imgURL} number={contacts[0].phone} mail={contacts[0].email} />
        <App name={contacts[1].name} image={contacts[1].imgURL} number={contacts[1].phone} mail={contacts[1].email} />
        <App name={contacts[2].name} image={contacts[2].imgURL} number={contacts[2].phone} mail={contacts[2].email} />
    </div>, document.getElementById("root"));



